    false,nt"url": null,nt"notes": "<p>Individuals eligible and enrolled simultaneously
    for Medicare and Medicaid commonly referred to as dual eligible or duals have often
    been cited as accounting for a disproportionate share of Medicare and Medicaid spending
    compared with non-dual eligible beneficiaries. In the Medicare program, dual eligible
    beneficiaries account for 16 percent of enrollees, but about 25 percent of expenditures.
    In Medicaid, they account for 18 percent of enrollees, but about 46 percent of expenditures.
    Despite important policy implications presented by duals, published information
    on this population is sparse.</p>n",nt"license_title": "License Not Specified",nt"extras":
